        <li>
          <Link href="/about"><a>About</a></Link>
        </li>
        
      </ul>

      <style jsx>
      {
        `
         ul{
           background-color: #333;
           color: #fff;
           display:flex
           list-style:none;

         }

         ul li{
           font-size: 20px;
           margin-right:20px
         }
         ul li a{
           text-decoration: none;
           
         }
        `
      }
      </style>
      
    </div>
)
